response.about:
Психологическая помощь и поддержка в тяжелых жизненных ситуациях и в ситуациях жизненного кризиса, помощь в разрешении внутренних конфликтов и конфликтов с окружающими людьми. 

Телефон для записи на консультацию: 
+7 914 364 12 24 
 Или через сайты: 

http://formaetsensum.ru/ 

Я специализируюсь на следующих
психологических проблемах:

- тяжелые эмоциональные состояния (горе, смятение, отчаяние, вина, разлука, тревога, одиночество, ощущение безысходности и бессмысленности жизни, пессимизм, подавленность и т.п.);
- кризисы жизни (мировоззренческие, профессиональные, творческие кризисы, кризисы самоопределения, жизненные тупики, возрастные кризисы и кризисы, вызванные потерей работы, тяжёлой болезнью, смертью близкого человека и расставанием);
- сложные жизненные ситуации, потеря смысла жизни, разочарование в жизни, в себе и в других людях;
- внутренние конфликты, конфликты с окружающими, семейные конфликты (в т.ч. супружеские измены).

Я работаю в стиле классического вербального консультирования («лечение разговором»), при этом использую элементы:
- экзистенциально-гуманистической психологии и психотерапии; 
- юнгианского анализа;
- когнитивно-поведенческой психологии;
- краткосрочной позитивной психотерапии;
- коучинга.
